import classes from "./Style.module.css";
import { Pie } from "react-chartjs-2";

var data = {
    labels: ["Red", "Green", "Orange"],
    datasets: [
        {
            data: [5, 9, 30],
            backgroundColor: [
                "rgba(255, 99, 132, 0.2)",
                "rgba(54, 162, 235, 0.2)",
                "rgba(255, 206, 86, 0.2)",
                "rgba(75, 192, 192, 0.2)",
                "rgba(153, 102, 255, 0.2)",
                "rgba(255, 159, 64, 0.2)",
            ],
        },
    ],
};

const PieChart = () => {
    var data = {
        labels: ["Red", "Green", "Orange"],
        datasets: [
            {
                data: [5, 9, 30],
                backgroundColor: [
                    "rgba(255, 99, 132, 0.2)",
                    "rgba(54, 162, 235, 0.2)",
                    "rgba(255, 206, 86, 0.2)",
                    "rgba(75, 192, 192, 0.2)",
                    "rgba(153, 102, 255, 0.2)",
                    "rgba(255, 159, 64, 0.2)",
                ],
            },
        ],
    };

    var options = {
        maintainAspectRatio: false,
        scales: {},
        legend: {
            labels: {
                fontSize: 25,
            },
        },
    };

    return (
        <div className={classes.container}>
            <Pie data={data} options={options} />
        </div>
    );
};

export default PieChart;
